con:config.script:
// create groovyUtils and XmlHolder for response
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def holder = groovyUtils.getXmlHolder( "listPipelines#Response" )

// loop item nodes in response message
for( item in holder.getNodeValues( "//item/identifier" )) {
	testRunner.testCase.setPropertyValue( "item", item);
	log.info "Item : $item" ;
	testRunner.runTestStepByName("getPipeline")


}
